INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "お！\nあそこに困ってそうな人発見！", 2, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, "春咲 ひより", 1.4, 1, 1001);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "みんなみたいに\nわたしも強くならなきゃ", "大切な人を\n守れるようになりたい…って", 2, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, "草野 優衣", 1.4, 1, 1002);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "フェンシングを始めてみては？", "キミに必要な集中力と感性が", 2, 0, "少しは磨かれると思いますよ。", 0, 0, "士条 怜", 1.4, 1, 1003);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ねぇ、にいちゃん！", "今日はなにして遊ぶ？", 2, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, "穂高 みそぎ", 1.5, 1, 1004);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "風宮あかりです", "ねぇ…", 2, 0, "私といっしょに…\nいかない？", 0, 0, "風宮 あかり", 1.4, 1, 1006);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "出雲宮子なのー", "プリンたべたいのー", 2, 0, "食べ物の恨みは怖いのー", 0, 0, "出雲 宮子", 1.5, 1, 1007);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ボクは虹村雪。", "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, "いいよ。\n見られることは運命さ…", 0, 0, "虹村 雪", 1.4, 1, 1008);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "フッ…聞いて後悔するがいい！", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, "人呼んで「疾風の冥姫」!!", 0, 0, "柊杏奈", 1.4, 1, 1009);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "マホマホ王国のプリンセス、\nまほ姫どす", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, "ほんまおおきにやわ～♪", 0, 0, "姫宮 真歩", 1.5, 1, 1010);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "衣之咲璃乃です！", "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, "ここで会ったが\n100年目～！", 0, 0, "衣之咲 璃乃", 1.4, 1, 1011);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "ち、超能力って…\n何のことかな～？", 2, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, 0, "柏崎 初音", 1.4, 1, 1012);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ちょす！\n美波鈴奈だよ～♪", "一応カリスマ読モJKやってまっす！", 2, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, "美波 鈴奈", 1.4, 1, 1016);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "はいたーい。\n喜屋武香織さー。", "東京は遊園地みたいなところさー", 2, 0, "でも、沖縄もとってもいいとこさー", 0, 0, "喜屋武 香織", 1.4, 1, 1017);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "支倉伊緒です。", "先生って呼ばれるのは\nくすぐったいから", 2, 0, "イオちゃんって呼んでね。", 0, 0, "支倉 伊緒", 1.4, 1, 1018);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, "ミミをおいてかないでぇ～", 0, 0, "茜 ミミ", 1.5, 1, 1020);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", "あの……\nふぇ……", 2, 0, "ふぇぇぇぇぇん……", 0, 0, "栗林 くるみ", 1.5, 1, 1021);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "風宮よりです。\nあああああ！", "こんな私に貴重な時間を\n割いていただき、", 2, 0, "なんてありがとうございます！", 0, 0, "風宮 より", 1.4, 1, 1022);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "おにいちゃんどこいくの？\nえ？", 2, 0, "私こっち行きたいー\nね、早く早くー", 0, 0, "北条 綾音", 1.5, 1, 1023);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "わっ…わっ…私、\n天野すずめといいます！", "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, "これて何か違う…\nあああすみません！", 0, 0, "天野 すずめ", 1.4, 1, 1025);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "……クスクス…私は\n…倉石恵理子……", "あなたは…運命の……\n伴侶……", 2, 0, "離しませんわ………\n絶対に…!!", 0, 0, "倉石 恵理子", 1.4, 1, 1027);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, "…そうでしょ？？", 0, 0, "佐々木 咲恋", 1.4, 1, 1028);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "桜井望だよ！\nよろしくねっ", "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, "あはは、\n私もまだまだだなぁ～", 0, 0, "桜井 望", 1.4, 1, 1029);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "デケデケデンっ！", "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, "ニノン・ジュベール", 1.4, 1, 1030);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "上喜しのぶです。\n手元のドクロが父です。", "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, "おかしいですね……", 0, 0, "上喜 しのぶ", 1.4, 1, 1031);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "目指すはビッグな\nお笑い芸人だっぺ！", "けんども\nそれには足りないモンが…", 2, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, 0, "野戸まひる", 1.5, 1, 1033);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょっと緊張しちゃって…", 2, 0, "ちょ\nちょっと一杯飲んできます…！", 0, 0, "綾瀬 ゆかり", 1.4, 1, 1034);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "氷川鏡華…です", "知らない人とは話しちゃいけないので", 2, 0, "これ以上お話しすることは…\nないです！", 0, 0, "氷川 鏡華", 1.5, 1, 1036);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "柏崎…栞です。", "……あ、アラーム。", 2, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, "柏崎 栞", 1.4, 1, 1038);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "ふ、双葉碧です。", "私、一人も友達がいなくて……", 2, 0, "野に咲く花が、\n唯一の話相手です。", 0, 0, "双葉 碧", 1.4, 1, 1040);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "三角千歌です。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, "そう思っています。", 0, 0, "三角 千歌", 1.4, 1, 1042);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "安芸真琴だ。", "あぁ？\nお前のそいつの仲間か？", 2, 0, "う、疑ってすまなかったな…", 0, 0, "安芸 真琴", 1.4, 1, 1043);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "わらわこそは夜を総べる者！", "生けとし生ける全ての者よ！", 2, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 0, "イリヤ・オーンスタイン", 1.4, 1, 1044);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "そこで騎士は妖精を乱暴に……", "ぐふふふふ……はっ！", 2, 0, "ｌク、クウカに何かご用ですか!?", 0, 0, "遠見 空花", 1.4, 1, 1045);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 0, "宮坂たまき", 1.4, 1, 1046);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "大神美冬よ！", "それでは早速クエストに…", 2, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 0, "大神 美冬", 1.4, 1, 1048);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "星野静流だよ！", "クエストもバトルも\n掃除も洗濯も", 2, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 0, "星野静流", 1.4, 1, 1049);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "アタシは玉泉美咲。", "見ての通りの\nセクシー美少女で", 2, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 0, "玉泉美咲", 1.5, 1, 1050);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "？？？", "？？？？", 2, 0, "？？？？", 0, 0, "リマ", 1.4, 1, 1052);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, "モニカ・ヴァイスヴィント", 1.5, 1, 1053);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, "ペコリーヌ", 1.5, 1, 1058);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, "コッコロ", 1.5, 1, 1059);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (1, 1, 0, 0, "モニカ・ヴァイスヴィントだ。", "菓子でつろうなどと\n稚拙な策を……", 2, 0, "そ、そこまでいうなら\nもらってやる", 0, 0, "キャル", 1.5, 1, 1060);
